import React from 'react'; 
import './GamesList.css';

const GamesList = ({games, closePopup}) => {

	let render = []; 
	let whiteplayer = /\[White\s"?(.*?)"?\]/; 
	let blackplayer = /\[Black\s"?(.*?)"?\]/; 
	let date = /\[Date\s"?(.*?)"?\]/; 

	return (
		<div className="games_container">
			{ games && 	 
				games.map((i, c) => {
					return (
						<div key={c+'game'} onClick={() => closePopup(i.pgn)} className="game">
							<div className="white">{i.match(whiteplayer)[1]}</div>
							<div className="date">{i.match(date)[1]}</div>
							<div className="black">{i.match(blackplayer)[1]}</div>
						</div>
					);
				}) 
			}
		</div>
	);
}
export default GamesList;
